import styled from "styled-components";
import React from "react";
import "../../../App.css";
import { Link } from "react-router-dom";
function InNavbar() {
  return (
    <Container>
      <logo>
        <h1>A. WorkSpace</h1>
      </logo>
      <Menu>
        <Link to="/InMail">InMail</Link>
        <Link to="/ClassRoom">ClassRoom</Link>
        <Link to="/Meetings">Meetings</Link>
        <Link to="/ChitChat">ChitChat</Link>
        <Link to="/Thoughts">Thoughts</Link>
      </Menu>
      <RightMenu>
        <Link to="/Account">MyProfile</Link>
      </RightMenu>
    </Container>
  );
}
export default InNavbar;

const Container = styled.nav`
  background-color: #ffffff;
  position: relative;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  display: flex;
  align-items: center;
  height: 92px;
  top: 0;
  left: 0;
  right: 0;
  logo {
    color: blue;
    position: absolute;
    size: 40px;
    width: 19.68px;
    height: 24.88px;
    left: 21px;
    top: 24px;
    font-weight: 800;
  }
`;
const RightMenu = styled.div`
  position: absolute;
  top: 26px;
  right: 30px;
  a {
    font-weight: 700;
  }
`;

const Menu = styled.div`
  display: flex;
  position: absolute;
  justify-content: space-around;
  width: 590px;
  height: 33px;
  background-color: #6cb9ff;
  top: 26px;
  left: 440px;
  border-radius: 47px;
  box-shadow: 7px 6px 16px 0px #00000040;
  border-style: hidden;
  :hover {
    background-color: #77baf8;
  }

  a {
    color: black;
    font-size: 13px;
    font-weight: 700;
    align-self: center;
    :hover {
      font-weight: 750;
      font-size: 13.5px;
    }
  }
`;
